import React from 'react';
import PropTypes from 'prop-types';
import { Container, Nav, NavItem, Navbar, NavbarBrand, NavbarCollapse, NavbarToggle } from 'react-bootstrap';

const mystyle = {
  color: "white",
  backgroundColor: "DodgerBlue",
  padding: "10px",
  fontFamily: "Arial"
};

export default function NavBar(props) {
  return (

    <Navbar style={{backgroundColor:'black'}} expand="lg" className='bg-body-tertiary' >
      <Container fluid>
        <NavbarBrand style={{backgroundColor:'gold'}}>Vanesara</NavbarBrand>
        <NavbarToggle aria-controls='navbarScroll'>
          <NavbarCollapse id='navbarScroll'>
            <Nav
              className="me-auto my-2 my-lg-0"
              style={{ maxHeight: '100px' }}
              navbarScroll
            >
              <Nav.Link href="#action1">Home</Nav.Link>
              <NavItem>Hello</NavItem>

            </Nav>

          </NavbarCollapse>
        </NavbarToggle>
      </Container>
    </Navbar>

  );
}
NavBar.propTypes = { applicationName: PropTypes.string, poweredByName: PropTypes.string.isRequired };
NavBar.defaultProps = { applicationName: "Application Name", poweredByName: "Company" };
